import React from 'react';
import { Link } from 'react-router-dom';
import styles from './page.module.css';
import dog from '../../img/dog.png'

export function Page() {
  return (
    <header>

      <div className={styles.container}>

        <div className={styles.text}>
          <h2>Dogs Api</h2>
          <Link to="/home">Home</Link>
        </div>

        <img src={dog} />

      </div>
      <div className={styles.wave}>
      <div style="height: 150px; overflow: hidden;" ><svg viewBox="0 0 500 150" preserveAspectRatio="none" style="height: 100%; width: 100%;"><path d="M0.00,49.98 C150.00,150.00 349.20,-50.00 500.00,49.98 L500.00,150.00 L0.00,150.00 Z" style="stroke: none; fill: #08f;"></path></svg></div>
      </div>

    </header>

  )
};

export default Page;
